import React, { useState } from 'react';
import Cards from './components/card';
import logo from './logo.svg';
import './App.css';

function App() {

  function generatenums () {
    let numarr = [];
  }

  const [randomarr, setRandomArr] = useState([4,8,12,17,3,9,28,19]);

  return (
    <div className="App">
    <ul class="cardlist">
      {randomarr.map((rand) => {
        return(
          <li key={rand}>
            <Cards
            value={rand}
            />
          </li>
        )
      })}
    </ul>
    </div>
  );
}

export default App;
